import React, {useState} from "react";


const Input = () => {
    const [txtValue, setTextValue] = useState("");

    const onChangeCall = (e) => {
        setTextValue(e.target.value)
    };

    return (
        <input type="text" value="" onChange={onChangeCall} />
    );
}

export default Input;
